import React, { Component } from "react";
import { WiThermometer } from "react-icons/wi";

class Amenu extends Component {
  render() {
    return (
      <div className="col-3 amenu text-center ">
        <h5 className="meteo-text my-5">
          <WiThermometer className="thermo-size" />
          METEOROLOG
          <hr className="hr" />
        </h5>
        <p>Dashboard</p>
        <p>Statistics</p>
        <p>Map</p>
        <p>Statistics</p>
      </div>
    );
  }
}

export default Amenu;
